import React from 'react';
import {Col, Row} from "react-bootstrap";
import CustomerTable from "./customerfetch";
import fetchdata from "./customerfetch";

function Customers () {
    let url = " http://localhost:8000/customer";
    const {data : customers, isPending, error} = fetchdata( url )
    const myTitle = "Customers"
    // const myTitle14 = " Books at 14.99"
    return (
        <Row>
            <Col sm={3}>
            </Col>
            <Col sm={3}>
                { error && <div> Error: {error} </div> }
                {isPending && <div> Loading ...</div>}
                { customers && <CustomerTable customers={customers} title={myTitle}/>}
            </Col></Row>
    )
}
export default Customers;
